import React from 'react';
import styles from './Detailcss.module.css';


const Todoitem=({item})=>{

    return(
        <div className={"item",`${styles.TodoItem}`} >
            <div className="starttime">Start time: {item.start_time} </div>
            <div className="endtime">End time{item.end_time}</div>
            <div className="more">Purpose{item.content}</div>
        </div>  
    );

};

export default Todoitem;
